void drawLine(int x0, int y0, int x1, int y1, short int colour){
	int temp, y_step;
	bool isSteep = ABS(y1-y0) > ABS(x1-x0);
	if(isSteep){
		//swap x0 and y0
		temp = x0;
		x0 = y0;
		y0 = temp;

		//swap x1 and y1
		temp = x1;
		x1 = y1;
		y1 = temp;
	}
	//flip if drawing backwards
	if(x0 > x1){
		//swap x0 and x1
		temp = x0;
		x0 = x1;
		x1 = temp;

		//swap y0 and y1
		temp = y0;
		y0 = y1;
		y1 = temp;
	}

	int deltax = x1 - x0; //we already know going forward
	int deltay = ABS(y1 - y0);
	int error = -(deltax / 2);
	int y = y0;

	if(y0<y1){y_step = 1;}
	else{y_step = -1;}

	for(int x=x0; x<x1; x++){
		if(isSteep){ plot_pixel(y, x, colour); }
		else{ plot_pixel(x, y, colour); }

		error = error + deltay;
		if(error >= 0){
			y = y + y_step;
			error = error - deltax;
		}
	}
}

