void wait_for_vsync(){
	volatile int *pixel_ctrl_ptr = (int*)0xFF203020;
	int status;

	//launch the swap process(derefence and write in)
	*pixel_ctrl_ptr = 1;
	//poll the status bit
	status = *(pixel_ctrl_ptr + 3);
	while( (status & 0x01)!=0 ){
		status = *(pixel_ctrl_ptr + 3);
	}
}

void toggleSelected()
{
	if (theArrow.selected == true)
	{
		theArrow.selected = false;
		return;
	}
	theArrow.selected = true;
}

void pickUpDisk()
{
	//updateArrowInfo();
	if (theArrow.selected == true)
	{
		return;
	}
	
	int currentTowerTop = theArrow.towerTop;
	if (currentTowerTop == 0)
	{
		return;
	}
	
	if (theArrow.location == 1)
	{
		deleteTop(&Tower1);  //updated the selectedDiskNumber
		theArrow.selected = true;
		return;
	}
	if (theArrow.location == 2)
	{
		deleteTop(&Tower2);  //updated the selectedDiskNumber
		theArrow.selected = true;
		return;
	}
	if (theArrow.location == 3)
	{
		deleteTop(&Tower3);  //updated the selectedDiskNumber
		theArrow.selected = true;
		return;
	}
}

void dropDisk()
{
	if (theArrow.selected == false)
	{
		return;
	}
	currCount++;
	
	if ((theArrow.towerTop != 0) && (theArrow.towerTop < theArrow.selectedDiskNumber))
	{
		errorMessage();
		return;
	}
	
	if (theArrow.location == 1)
	{
		if ((theArrow.towerTop == 0) || (theArrow.towerTop > theArrow.selectedDiskNumber))
		{
			append(&Tower1, theArrow.selectedDiskNumber);
			theArrow.selected = false;
			return;
		}
		
	}
	if (theArrow.location == 2)
	{
		if ((theArrow.towerTop == 0) || (theArrow.towerTop > theArrow.selectedDiskNumber))
		{
			append(&Tower2, theArrow.selectedDiskNumber);
			theArrow.selected = false;
			return;
		}
	}
	if (theArrow.location == 3)
	{
		if ((theArrow.towerTop == 0) || (theArrow.towerTop > theArrow.selectedDiskNumber))
		{
			append(&Tower3, theArrow.selectedDiskNumber);
			theArrow.selected = false;
			return;
		}
	}

}

int keyBoardData(char byte1, char byte2, char byte3)
{
  unsigned char nibbles[] = {0, 0, 0, 0, 0, 0, 0, 0};
  unsigned int shift_buffer, nibble;

  shift_buffer = (byte1 << 16) | (byte2 << 8) | byte3;

  for (int i = 0; i < 6; i++)
  {
    nibble = shift_buffer & 0x0000000F; //
    nibbles[i] = nibble;
    shift_buffer = shift_buffer >> 4;
  }

  return getDirections(nibbles);
}

int getDirections(unsigned char nibbles[])
{
  //UP DIRECTION (W 1DFO1D or Up Arrow EOF075)
  if (((nibbles[5] == 1) && (nibbles[4] == 13) && (nibbles[3] == 15) && (nibbles[2] == 0) && (nibbles[1] == 1) && (nibbles[0] == 13))
  ||  ((nibbles[5] == 14) && (nibbles[4] == 0) && (nibbles[3] == 15) && (nibbles[2] == 0) && (nibbles[1] == 7) && (nibbles[0] == 5)))
  {
  	return UP;
  }

  //DOWN DIRECTION (S 1BFO1B or Down Arrow EOF072)
  if (((nibbles[5] == 1) && (nibbles[4] == 11) && (nibbles[3] == 15) && (nibbles[2] == 0) && (nibbles[1] == 1) && (nibbles[0] == 11))
  ||  ((nibbles[5] == 14) && (nibbles[4] == 0) && (nibbles[3] == 15) && (nibbles[2] == 0) && (nibbles[1] == 7) && (nibbles[0] == 2)))
  {
  	return DOWN;
  }

  //LEFT DIRECTION (A 1CFO1C or Left Arrow EOF06B)
  if (((nibbles[5] == 1) && (nibbles[4] == 12) && (nibbles[3] == 15) && (nibbles[2] == 0) && (nibbles[1] == 1) && (nibbles[0] == 12))
  ||  ((nibbles[5] == 14) && (nibbles[4] == 0) && (nibbles[3] == 15) && (nibbles[2] == 0) && (nibbles[1] == 6) && (nibbles[0] == 11)))
  {
  	return LEFT;
  }

  //RIGHT DIRECTION (D 23F023 or Right Arrow EOF074)
  if (((nibbles[5] == 2) && (nibbles[4] == 3) && (nibbles[3] == 15) && (nibbles[2] == 0) && (nibbles[1] == 2) && (nibbles[0] == 3))
  ||  ((nibbles[5] == 14) && (nibbles[4] == 0) && (nibbles[3] == 15) && (nibbles[2] == 0) && (nibbles[1] == 7) && (nibbles[0] == 4)))
  {
  	return RIGHT;
  }
	
	//RKEY (R 2DFO2D)
  if ((nibbles[5] == 2) && (nibbles[4] == 13) && (nibbles[3] == 15) && (nibbles[2] == 0) && (nibbles[1] == 2) && (nibbles[0] == 13))
  
  {
  	return RKEY;
  }
 
  return 0;
}

void getKey(){
	
	      //keyBoardStuff
        volatile int * PS2_ptr = (int *)PS2_BASE;
  int PS2_disk, RVALID;
  char byte1 = 0, byte2 = 0, byte3 = 0;

  *(PS2_ptr) = 0xFF; // reset

   //while begin
   while (1)
   {
   	PS2_disk = *(PS2_ptr);
   RVALID = PS2_disk & 0x8000; 			// extract the RVALID field

   if (RVALID)
   {
   	    /* shift the next data byte into the display */
         byte1 = byte2;
         byte2 = byte3;
         byte3 = PS2_disk & 0xFF;

          
	if ((fakeCount == 0) || (fakeCount ==1))
	{
		updateArrowInfo();
		fakeCount++;
		break;
	} 
	   
	   
	   if (keyBoardData(byte1, byte2, byte3)  == RKEY)
         {
            if ((gameWon ==true) && (gameReset == false))
			{
				gameReset = true;
				break;
			}
		    if ((gameWon == false) && (hardReset == false))
			{
				hardReset = true;
				break;
			}
         }
	   
	   if (keyBoardData(byte1, byte2, byte3)  == UP)
         {
           eraseErrorMessage();
		   if (theArrow.selected == true)
         	{
         	    errorMessage();
         		break;
         	}
         	pickUpDisk();
         	updateArrowInfo();
         	break;
         }
         
          if (keyBoardData(byte1, byte2, byte3)  == DOWN)
         {
             eraseErrorMessage();
			if (theArrow.selected == false)
         	{
         		errorMessage();
         		break;
         	}
         	dropDisk();
         	updateArrowInfo();
         	break;
         }
          if (keyBoardData(byte1, byte2, byte3)  == LEFT)
         {
			eraseErrorMessage();
         	if (globalArrowLocation == 1)
         	{
         		globalArrowLocation = 3;
				updateArrowInfo();
				break;
         	}
         	globalArrowLocation--;
         	updateArrowInfo();
         	break;
         }
         if (keyBoardData(byte1, byte2, byte3)  == RIGHT)
         {
			eraseErrorMessage();
         	if (globalArrowLocation == 3)
         	{
         		globalArrowLocation = 1;
				updateArrowInfo();
				break;
         	}
         	globalArrowLocation++;
         	updateArrowInfo();
         	break;
         }
   }
   }
}

