void displayHEX()
{

/* SEVEN_SEGMENT_DECODE_TABLE gives the on/off settings for all segments in
* a single 7-seg display in the DE1-SoC Computer, for the hex digits 0 - F
*/
unsigned char seven_seg_decode_table[16] = {
	0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07,
0x7F, 0x67, 0x77, 0x7C, 0x39, 0x5E, 0x79, 0x71};

int minTens, minOnes, currTens, currOnes;
minTens = minCount / 10;
minOnes = minCount % 10;
currTens = currCount / 10;
currOnes = currCount % 10;


int hex0 = seven_seg_decode_table[currOnes];
int hex1 = seven_seg_decode_table[currTens];
int hex4 = seven_seg_decode_table[minOnes];
int hex5 = seven_seg_decode_table[minTens];

hex1 = hex1 <<8 | hex0;
hex5 = hex5 <<8 | hex4;
/* drive the hex displays */
*HEX3_HEX0_BASE =  hex1;
*HEX5_HEX4_BASE = hex5;

}

