//function from http://www-ug.eecg.utoronto.ca/desl/nios_devices_SoC/dev_vga.html
void write_char(int x, int y, char c)
{
  // VGA character buffer
  volatile char * character_buffer = (char *) (0xc9000000 + (y<<7) + x);
  *character_buffer = c;
}

